import React from 'react'
import { useState } from 'react'
import { json, useNavigate } from 'react-router-dom';
export default function Login() {
    const [email,setEmail]=useState("");
    const [pass,setPass]=useState("");
    const navigate=useNavigate();
    const print= async()=>
    {
        console.log(email , pass);
        let result=await fetch('http://localhost:5000/login',{
            method:'post',
            body:JSON.stringify({email,pass}),
            headers:{
                'Content-Type':'application/json'
            },
        });
        result=await result.json();
        console.log(result);
        if(result.name)
        {
            localStorage.setItem("user",JSON.stringify(result));
            navigate('/');
        }
        else{
            alert("please enter corrrect details");
        }

    }
  return (

    <div className='login'>
        <h1 >Login</h1>
        <input type='text' className='inputbox' placeholder='Enter Email' value={email} onChange={(e)=>setEmail(e.target.value)}/>
        <input type='password' className='inputbox' placeholder='Enter Password' value={pass} onChange={(e)=>setPass(e.target.value)}/>
        <button className='appbtn' type='button' onClick={print}>Login</button>
        

    </div>
  )
}
